angular.module('app.services', [])
    .factory('SQLFactory', [function () {

}])
    .service('NewsService', ['$q', '$cordovaSQLite', '$rootScope', function ($q, $cordovaSQLite, $rootScope) {
        'use strict';
        var deferred = $q.defer();
        var hasDatabase = false;
        var news = [];

        var newsTemplate = [{
            author: 'Araja',
            icon: 'ion-ios-eye-outline',
            title: 'Addonstart!',
            guildId: '0',
            date: '01.09.2016',
            image: '',
            text: 'Die Legion kommt. Macht euch bereit!'
    }];

        var connectToDatabase = function () {
            //  var query = 'DELETE FROM News;';
            //  $cordovaSQLite.execute($rootScope.db, query)
            ///      .then(function (result) {
            //          lastLocation.splice(0);
            $cordovaSQLite.execute($rootScope.db, 'INSERT INTO News (guildId,title,text,img,icon,date,author) VALUES (?,?,?,?,?,?,?);', [newsTemplate[0].guildId, newsTemplate[0].title, newsTemplate[0].text, newsTemplate[0].image, newsTemplate[0].icon, newsTemplate[0].date, newsTemplate[0].author])
                .then(function (result) {
                    //      lastLocation.push(news[0]);
                }, function (error) {
                    alert("Error on saving: " + error.message);
                });
            //      }, function (error) {});
        };

        var getNews = function (b) {
            if (b)
                hasDatabase = b;
            if (hasDatabase) {
                $cordovaSQLite.execute($rootScope.db, 'SELECT * FROM News;').then(
                    function (result) {
                        news.splice(0);

                        //  console.log(res.rows);
                        for (var i = 0; i < result.rows.length; i++) {
                            news.push(result.rows.item(i));
                        }
                        deferred.resolve(news);
                    },
                    function (error) {
                        deferred.reject("Error on loading: " + error.message);
                        alert("Error on loading: " + error.message);
                    }
                );
            }
            return deferred.promise;

        };

        return {
            connectToDatabase: connectToDatabase,
            getNews: getNews
        };
}]);